window.bookSummaryJSON = "<p>Where to turn when all roads lead to ruin? Last night I barely escaped 1776 New York City - now I have to go back.</p> <p>My teammates are trapped in a time catch. Worse, the demon master Malphas is building a gateway there, one that could trigger a full-blown apocalypse.</p> <p>But returning will require new allies: A crabby goblin, a fae princess and former lover, and the demon-vampire Arnaud. Yeah, that guy. And we’re no longer facing one time catch, but several. All ruptured and on the verge of collapse.</p> <p>Now a simple rescue has turned into a death-defying journey, one that’s pushing my spell casting and stamina to their limits.</p> <p>But as hellfire lashes up and day dims to eternal night, I’m facing an even greater test...</p> <p>Choosing between my faith in magic and my love for Vega. <br> </p> <p><i>Night Rune</i> is the 8th novel in the urban fantasy series. If you like occult action, spell-crackling suspense, and moments of heart, heroism, and all-out laughter, you’ll love Prof Croft!</p> <p>Books in the Croftverse:</p> <p><b>Prof Croft Series</b> </p> <ul> <li>Preq 0: <i>Book of Souls</i> </li> <li>Book 1: <i>Demon Moon </i></li> <li>Book 2: <i>Blood Deal </i></li> <li>Book 3: <i>Purge City </i></li> <li>Book 4: <i>Death Mage </i></li> <li>Book 5: <i>Black Luck </i></li> <li>Book 6: <i>Power Game </i></li> <li>Book 7: <i>Druid Bond</i> </li> <li>Book 8: <i>Night Rune </i></li> </ul> <p><b>Blue Wolf Series</b> </p> <ul> <li>Book 1: <i>Blue Curse</i></li> <li>Book 2: <i>Blue Shadow</i></li> <li>Book 3: <i>Blue Howl</i></li> <li>Book 4: <i>Blue Venom</i></li> </ul>"; 
